`;function l1(){return c.jsxs(s1,{children:[c.jsx(ae,{img:nm,alt:"foto de um leão marinho em cima de rochas de coloração amarronzada, em Paracas"}),c.jsx("h3",{children:"Paracas, Peru | 2023"}),c.jsx("p",{children:"Cinco dias no Peru. Essa era a ideia inicial. Comecei a pesquisar sobre este país e rapidamente acrescentei mais cinco dias. E se eu pudesse, teria ficado mais. Pra quem leu sobre Guna Yala já sabe que fui com uma amiga. Com ela fui pra Cusco, onde estão os passeios mais solicitados. Machu Picchu não poderia faltar, mas escolhi falar de um destino menos conhecido."}),c.jsx("p",{children:"Em Paracas a atração principal são as Islas Ballestas, conhecida como mini Galápagos do Peru, que fica na Reserva Nacional de Paracas. Minha gente, antes das minhas pesquisas jamais que iria imaginar que numa viagem de dez dias pelo Peru eu iria visitar sítios arqueológicos, montanhas há mais de 5 mil metros de altitude, que iria presenciar vários leões-marinhos de perto, pinguins, encontro de deserto e mar além de me hospedar numa vila que é basicamente um oásis no meio do deserto."}),c.jsx("p",{children:"Eu já disse que viajar de trip tem a vantagem de a agência organizar tudo pra ti, fazer a parte “chata”. Mas só é chata quando não temos tempo para pesquisar e organizar tudo. É maravilhoso nós mesmas montarmos nosso roteiro, do nosso jeitinho. A viagem já começa muito antes da estrada. Eu amo as trips para viagens curtas, em especial as que envolvem muitos translados, passeios. Para as minhas férias prefiro eu mesma planejar, dependendo do destino. Nunca que eu ia encontrar uma agência/expedição que incluísse Cusco, Paracas, Huacachina, Cidade do Panamá e Guna Yala na mesma viagem. Só eu pra ter essas ideias, heheh. Mas se você tiver um desejo mais fora do comum, como eu, e estiver insegura com o planejamento, há a possibilidade de contratar consultoras de viagem, elas montam seu roteiro personalizado e te dão várias dicas do destino."}),c.jsx("p",{children:"Vou resumir em ordem cronológica essa viagem, começando por Lima, pois já cheguei passando perrengue. Optei por já comprar um chip no aeroporto, meu cartão da wise não passou… Tentei algumas vezes e nada, tentei com o cartão global do C6 e foi, uffa. Fui sacar dinheiro e nada, que desespero! Ainda no Brasil, vi que não precisava desbloquear nada, não sabia o que poderia ser. Bora pedir um uber. Inocente caí na conversa de um taxista dizendo que uber era do lado de fora do aeroporto. Não parei por aí, decidi ir com ele, com um amigo dele, na real. Ele tentou passar meu cartão antes, lembro dele perguntar se era crédito e disse que seria melhor, mas optei por passar o cartão que ja tinha usado. Compra não aprovada, estranhei mas não o bastante pra sair do carro. Tentei no crédito, passou. Ele pediu pra eu confirmar no celular. Estava tendo dificuldades com o app e quase deixando pra lá qdo achei a compra, o cara me cobrou dez vezes a mais… Por isso o primeiro cartão não passou, não tinha saldo suficiente. Ele ia estornar, pediu a senha de novo, “o que eu faço?”. Digitei a senha, esperei atualizar no app e sai do carro dele. Ele ainda veio falar que o valor combinado da corrida (mesmo valor do uber) era em dólar e não em soles (moeda peruana e com câmbio próximo ao real). Eu disse que não e fui pedir meu uber. Bloqueei meu cartão, no Brasil pedi outro. Pq ele pediu pra eu conferir, eu não sei. Talvez fosse pra eu aceitar ir pagando em dólar e sem reclamar, poderia ter me sentido mais intimidada e aceitado. Enfim, no final deu certo, conferi inúmeras vezes minha fatura e não tinha nada de errado. Mas, o ocorrido afetou meu dia em Lima… No hostel meu cartão wise passou. Do lado tinha um restaurante, pedi uma pizza individual e double pisco sour, drink típico do Peru. Curti minha cia no restaurante e fui dormir. Escolhi um quarto  individual no hostel pois a noite anterior passei no aeroporto. De manhã segui pra Cusco, encontrei minha amiga no aeroporto de lá."}),c.jsx("p",{children:"No aeroporto consegui sacar dinheiro, boa parte dos caixa eletrônicos cobram taxa, então saquei o suficiente para os dias seguintes. Sempre que dava, pagava no cartão de débito. Eu e minha amiga optamos por agência para os dias que passaríamos em Cusco. Pesquisamos muito até achar uma que parecia confiável e com bons preços. Fizemos a escolha certa. Em um desses papos nos passeios descobrimos que uma moça pagou quase o mesmo valor que nós pagamos pra cinco dias com passeios, transfer e hospedagem, só pra ir pra Machu Picchu. E claro, no nosso pacote tbm estava incluído esse passeio, indo de trem. Falam que é bem tranquilo deixar pra fechar os passeios lá, exceto Machu Picchu, mas como não ia sozinha não quis pegar pra mim essa responsa de planejar tudo. Se quiserem o contato da agência ou dicas de Cusco, só me chamar. De Cusco, fomos de avião para Lima. Passamos o dia e noite juntas, na manhã seguinte eu segui sozinha para Paracas, minha amiga voltou pro Brasil."}),c.jsx("p",{children:"Os turistas que não vão apenas pra Cusco costumam iniciar sua viagem por Paracas e depois seguir por mais cidades até chegar em Cusco. Há uma empresa que faz esse trajeto de ônibus, incluindo alguns passeios. Tem saída todos os dias e você escolhe se vai pernoitar na cidade ou não. O bacana de chegar em Cusco de ônibus é que além de conhecer várias cidades você também vai subindo de altitude aos poucos. O soroche, mal de altitude, deixou eu e minha amiga muito mal no primeiro dia em Cusco."}),c.jsx("p",{children:"Voltando a Paracas… Fiz a viagem de três dias com a empresa que citei anteriormente, me buscaram no hostel. Na primeira parada já percebi que tinham poucos latinos, diferente de Cusco. Esse foi um ponto negativo já que não falo inglês, mas poderia ter sido positivo se eu estivesse disposta a treinar meu inglês ruim, kkkk. Confesso que eu não esperava por isso, mas tanto em Paracas como em Huacachina eu encontrei poucas pessoas que falavam espanhol como primeira opção. Mas no ônibus, que nos levavam tanto pro hostel como pra alguns passeios, a guia falava tanto inglês como espanhol. Ah, em Guna Yala, apesar de a língua do país ser espanhol, eu já imaginava que teriam poucos latinos tbm, e assim foi."}),c.jsx("p",{children:"Tem muitas viagens que eu tô super a fim de socializar, até esqueço a timidez, já outras que prefiro ficar mais na minha. Esses últimos dias no Peru, fiquei mais sozinha mesmo. Mas isso não quer dizer que não curti, pelo contrário, eu amei conhecer Paracas e Huacachina. No primeiro dia fiquei curtindo a praia e a noite teve uma banda de rock no próprio hostel, então fiquei por lá mesmo."}),c.jsx("p",{children:"O segundo dia fomos conhecer as Islas Ballescas e Parque Nacional de Paracas. Primeiro passeio foi de barco, vimos pinguins, leões-marinhos, coisas lindas!!! Como não estar feliz nesse lugar? Depois fomos pro deserto, paisagens lindas, paredões, praia vermelha. Algo que amei no Peru foram as paisagens, tão diversas, ficava encantada, inclusive durantes os trajetos. Ah, no mesmo dia seguimos pra Huacachina e fizemos passeio de buggy nas dunas. Que dia! Descemos de snowboard nas dunas, teve uma delas que a altura me impressionou bastante. Ainda bem que sugeriram de eu trocar minhas havaianas por bota. Ia lascar meu pé tentando frear esse trem! Hahaha. Ainda hoje tenho areia de Huacachina na minha bota… rs"}),c.jsx("p",{children:"Acertei demais no hostel que escolhi em Huacachina. Eu conseguiria desconto em outro hostel muito bem recomendado. Mas sabe quando você sente que tem que ir pra outro lugar? Segui minha intuição e fui feliz. O outro hostel era mais badaladinho mas eu não estava nessa vibe. E uma escolha de meses atrás foi a melhor  pro meu momento durante a viagem. Ele tinha um ambiente muito agradável, uma piscina gracinha e uma vista maravilhosa pro oásis. Amei."}),c.jsx("p",{children:"Vamos de diquinhas:"}),c.jsxs("ol",{children:[c.jsx("li",{children:"Perrengues acontecem mas mantenham a calma. Com certeza o fato do meu cartão não ter funcionado de primeira me abalou a ponto de eu cair na conversa do taxista logo em seguida. Não estava tão despreparada assim pra me desesperar. Tinha dois cartões de débito além de uns dólares em espécie. E tbm cartão de crédito que já estava habilitado pro exterior. Vá sempre com mais de uma opção."}),c.jsx("li",{children:"Atenção aos valores cobrados. Não vi o valor cobrado no táxi e confiei. Por muito pouco não sai com um grande prejuízo. Tirei foto do cara com sua suposta credencial, caso surgisse um valor cobrado posteriormente no meu cartão. Em alguns lugares os valores cobrados por taxista é tabelado, se não for, combine o preço antes de entrar no carro. Mas, sempre que possível, eu pego uber."}),c.jsx("li",{children:"Esses perrengues servem como aprendizado. Não desanime, apesar do ocorrido em Lima, na Cidade do Panamá eu sai do aeroporto sem internet e de táxi. Não ia desfalcar minha viagem se eu tivesse comprado o chip no aeroporto pra pedir meu uber, mas eu já estava vacinada. Fui de táxi e ainda consegui desconto, mas dessa vez paguei com dinheiro"}),c.jsx("li",{children:"Não crie barreiras que te impeçam de viajar. A solitude é um caminho sem volta. Fui super animada pra Cusco com minha amiga e foi incrível o que passamos juntas, mas eu estava com saudades de me aventurar sozinha, e esse foi um dos motivos pelo qual eu prolonguei minha viagem. Os guias que eu tive o prazer de conhecer nos últimos dias da viagem foram muito especiais, ia embora com um aperto no coração. E sobre o idioma… Não, eu não falo espanhol. Mas me virei muito bem com o portunhol. Como conversei com algumas pessoas durante o planejamento da viagem fui aprendendo umas palavras que seriam bem úteis, tipo desayuno, que é café da manhã. Mas de forma geral as palavras são bem semelhantes."}),c.jsx("li",{children:"E mais uma vez, façam seguro viagem. Principalmente se forem pra Cusco. Cada organismo reage de uma forma com a altitude, eu e minha amiga sentimos muito o soroche no primeiro dia. Se tiver tempo disponível reserve o dia da chegada apenas pra descansar caso vão pra Cusco ou outra cidade de altitude elevada."})]}),c.jsx("footer",{children:c.jsx(at,{})})]})}const u1=Ce.div`
