`;function c1(){return c.jsxs(u1,{children:[c.jsx(ae,{img:rm,alt:"foto dos Lençóis Maranhences"}),c.jsx("h3",{children:"Rota das Emoções, MA PI CE | 2022"}),c.jsx("p",{children:"Mais um destino que entre eu conhecer e ir demorou menos de um ano."}),c.jsx("p",{children:"Tem vontade de conhecer os Lençóis Maranhences? Jeri? Então reserve uns nove dias e faça a Rota das Emoções. Além de conhecer esses dois destinos incríveis, você tbm conhecerá um pouco do Piauí. Um dos litorais mais lindos que já fui. Vou dar uma resumida, impossível descrever em detalhes o que foi essa viagem"}),c.jsx("p",{children:"O mais comum é iniciar a viagem pelo Maranhão. Os Lençóis não é parecido com nada que vc já tenha visto na vida. Mas é importante verificar as melhores épocas para visitar e poder aproveitar ao máximo."}),c.jsx("p",{children:"Depois dos Lençóis, fui visitar os Pequenos Lençóis. Nosso Brasil é especial demais, não se engane pelo nome da “pequena” atração. Mais um dia de Grandes Emoções."}),c.jsx("p",{children:"Partiu Delta do Parnaíba, divisa do Maranhão com Piauí. Lindo demais vc navegar minutos no Rio Parnaíba e então chegar em dunas, do nada!!! Pra mim foi bem especial me banhar nas águas do Rio Parnaíba, painho é do Piauí e se tem algo que ele fala o tempo todo, é desse rio. Mas a grande atração é a revoada dos guaras. Esse com certeza foi um dos momentos mais emocionantes da minha vida. Todo final de tarde os guaras voam pra uma ilha no meio do Rio Parnaíba para pernoitar. Centenas de guaras. CENTENAS. Cena linda de ver, emocionante demais. A ilha em alguns minutos fica vermelhinha, tamanha quantidade de guaras."}),c.jsx("p",{children:"No Piauí me hospedei em Barra Grande. Que delícia de lugar. Algumas pessoas não passam pelo litoral do Piauí por não ser muito conhecido, mas é lindo demais. Água delícia, vazia e dependendo do local, sem ondas. Barra Grande é bem conhecida por quem curte kitsurf, amava assistir a galera praticando."}),c.jsx("p",{children:"Depois parti pra Jericoacora. Aquelas lagoas com rede na água não são apenas bonitas, são maravilhosas. Fiz dois dias de passeio tbm. Lado leste e oeste. E o centrinho de Jeri é muito bom, todo dia tem música entre as barraquinhas de caipirinha, além de diversos restaurantes, lojinhas. Último dia passei em Fortaleza."}),c.jsx("p",{children:"Em suma, você vai de avião até São Luís, no Maranhão, vai seguindo por via terrestre pro Piauí e então Ceará. De Fortaleza, volta pra casa. Uma maneira maravilhosa de conhecer três estados."}),c.jsx("p",{children:"A dica de ouro para viajantes solos é fechar com uma agência os tranfers e passeios mas a hospedagem reservar por conta. Com essa escolha economizei mais de mil reias e nem reservei apenas hostel. A agência que escolhi foi perfeita, tudo muito bem organizado, sempre enviam por WhatsApp as orientações dos dias seguintes."}),c.jsx("p",{children:"Bem comum ir encontrando as mesmas pessoas pelo caminho, mas é bem flexível, vc decide quais cidades quer conhecer e quanto tempo ficar. Foi nessa viagem que conheci minha amiga Euridice. Nos conhecemos no segundo dia e tivemos a alegria de seguir juntas até Jeri. Mas eu fiquei uns dias a mais lá."}),c.jsx("p",{children:"Nessa viagem, houve bastante troca de hospedagens, fiquei em cinco cidades diferentes. Reservei em São Luís apenas um dia, pois cheguei de madrugada e o transfer me buscaria pela manhã. Depois que reservei o voo que lamentei pelo horário pois não teria tempo de conhecer o centro histórico, passei apenas de uber."}),c.jsx("p",{children:"As três primeiras hospedagens optei por simplicidade mas com quarto privativo. Em Barra Grande, achei a maioria bem cara. Encontrei uma que era um quarto minúsculo, mas já sabia devido aos comentários no Booking. A primeira vantagem foi eu ter aproveitado a piscina na mesma noite que cheguei pois estava vazia e muito mais agradável que meu quartinho, rsrs. No segundo dia, pedi pra ver uma tal de cabana, no mesmo lugar. Amei, bem espaçosa, aconchegante, diferente e só 50 reais a mais a diária. Troquei de quarto e fui muito feliz! Tinha chuveiro, na outra era só ducha!"}),c.jsx("p",{children:"Em Jeri optei por hostel. Um hostel só pra mulheres!!! Eu amei! O comum é ter quartos só pra mulheres, nesse caso era o hostel inteiro! Fiquei mais dias do que o padrão do pacote da agência, esse foi um dos motivos de ter escolhido hostel em Jeri. Os passeios deixei pra reservar quando estivesse por lá. Fiz a escolha certa."}),c.jsx("p",{children:"O primeiro dia teve passeio pela agência, Lagoa do Paraíso. Na volta fui na Pedra Furada com minha amiga. No segundo dia reservei passeio com ela tbm, fomos pro lado leste. A noite saímos com uma colega que fiz no hostel, Myllena. A Euridice foi embora nessa noite. Ainda fui pras Caipirinhas com essa colega e depois pra um luau. Esse luau nos deixou um pouco decepcionadas, pois era de música eletrônica… Fui pensando em violão e voz, típico de luau, né! Rs"}),c.jsx("p",{children:"Terceiro dia fui pra praia que teve o Luau. Fui sozinha mesmo, mas a tarde me encontrei com a Myllena. Ficamos num quiosque beira mar. Atravessamos uma barreira de algas pra entrar no água, não era época mas tinham muuuitas. Ela foi embora a noite. Mas chegou uma guria e fizemos amizade tbm, Júlia. Fui pras Caipirinhas de novo com essa nova colega. Qdo íamos voltar pro hostel, encontrei com um cara que conheci em Barra Grande. Tinha boatos de que teria outro luau. Fomos pra praia e estava  vazia, ficamos lá curtindo o céu lindo, bem estrelado."}),c.jsx("p",{children:"Dia seguinte fiz o passeio lado oeste com a Júlia. Esse teve mais adrenalina, amei! Final da tarde chegou outra garota no hostel, Priscila, combinei de ir ver o pôr do sol com ela, das dunas. Júlia já tinha ido pra lá no dia anterior. A noite fui com a Priscila e com a Júlia pra um forrozinho. Última noite em Jeri, como fui feliz!!!"}),c.jsx("p",{}),c.jsxs("ol",{children:[c.jsx("li",{children:"Eu repetindo que é bom viajar por conta e tô aqui falando de mais uma viagem com agência! kkkk A dica de ouro para viajantes solos na Rota das Emoções é fechar com uma agência os transfers e passeios, mas a hospedagem reservar por conta. Com essa escolha economizei mais de mil reais e nem reservei apenas hostel, além de ter ficado mais dias que o pacote padrão e ter escolhido um hotel melhor em Fortaleza (último dia e eu merecia, rs)."}),c.jsx("li",{children:"A agência que escolhi foi perfeita, tudo muito bem organizado, sempre enviavam por WhatsApp as orientações dos dias seguintes. Em alguns passeios é necessário carro 4x4, em Jeri e em Barra Grande não pode/precisa de carro. A não ser que você ame viajar de carro, não compensa, vá de agência."}),c.jsx("li",{children:"Acertei nas minhas escolhas de hospedagem. Assim que comecei a viajar, hostel ou camping eram as únicas opções que cabiam no meu bolso. Nessa viagem eu não estava tão engessada financeiramente, mas isso não quer dizer que eu optei por hospedagens caras, pelo contrário. Eu tinha o roteiro, sabia que ia passar o dia inteiro em passeios, então optei por reservar quartos individuais porém simples, só precisava dormir e queria privacidade."}),c.jsx("li",{children:"Comentei acima que troquei de “quarto” em Barra Grande, foi perfeito. A pousada também foi maravilhosa, tive dia livre por lá, então aproveitei bem a área comum com meus colegas lagartos."}),c.jsx("li",{children:"Em Jeri escolhi hostel não pelo preço, mas sim por estar aberta a fazer amizades. Lá eu só tinha um passeio programado e ficaria quatro dias. Falei acima, resumidamente, como foram os dias por lá, não fiquei um dia ou noite sozinha, conheci muitas garotas bacanas, como amei essa viagem."}),c.jsx("li",{children:"Em Fortaleza só passaria um dia e queria relaxar. Quarto em frente ao mar, rede na varanda, piscina. Uma diária lá foi mais cara que quatro dias em Jeri. Ambos cumpriram meu propósito."}),c.jsx("li",{children:"Viajar sozinha é sobre isso, mana, só tem grana pra hostel? Vá sem medo. Tem uma graninha a mais? Pense pra onde está indo e qual o seu desejo. Se eu tivesse fechado tudo com a agência, além de pagar por duas pessoas (pousadas cobram a mais quando é só uma pessoa) dificilmente eu teria essa flexibilidade de escolher hotel duas estrelas com quatro estrelas no mesmo roteiro. Eu sabia o que eu queria e foi muito melhor do que eu esperava."}),c.jsx("li",{children:"Deixa a vida te levar! Tenha sua listinha de lugares pra viajar, mas sempre deixe aberto para novos destinos. Como falei no começo, entre conhecer a Rota das Emoções e ir, não demorou um ano. Fiquei encantada, precisava conhecer esses lugares desse jeitinho. Foi lindo!"}),c.jsx("li",{children:"Especialmente nas primeiras viagens solo, opte por lugares mais seguros, cidades, vilas menores. Em Jeri não há iluminação nas ruas, apenas das casas e comércios. A primeira coisa que me falaram no hostel foi isso e sobre a segurança: “É escuro em alguns lugares? Sim. Mas você estará segura aqui.”"}),c.jsx("li",{children:"Em algumas ocasiões andei sozinha à noite por lá, e realmente me senti muito segura. Leve em consideração a localização da sua hospedagem quando for reservar. Leia os comentários das mulheres. Mas, se sua vibe é mais cidade grande, se joga também. E tome os mesmos cuidados que já está acostumada. Prefira Uber, avise a conhecidos onde está."}),c.jsx("li",{children:"Vim do futuro pra dar essa dica, hahah. Uma viagem recente que fiz foi pro Atacama e Salar do Uyuni (junho 24). E foi mais ou menos em meia hora que decidi comprar a passagem pro Atacama e ir sozinha, promoções mexem comigo! kkkk Imagina se eu ia conseguir convencer alguém a fazer essa loucura?! Nem sabia exatamente o que ia encontrar lá! Mas, tá aí mais uma vantagem de viajar sozinha, você decide quando, como e onde. Só vai!"})]}),c.jsx("footer",{children:c.jsx(at,{})})]})}const d1=Ce.div`
