`;function f1(){return c.jsxs(d1,{children:[c.jsx(ae,{img:am,alt:"foto do pôr do sol em Morro de São Paulo mostrando também o mar com alguns barcos"}),c.jsx("h3",{children:"Morro de São Paulo, BA | 2022"}),c.jsx("p",{children:"Não tem como esquecer a pandemia, né! Eu precisava viajar depois de anos em casa. Decidi viajar com minha mãe, dar de presente pra nós duas uma viagem pois merecíamos depois de passar por tudo isso. Decidimos ir para Porto de Galinhas. Porém, apesar de eu adorar viajar com minha mãe, eu estava precisando de uma viagem solo tbm. Quem já viaja sozinha vai me entender. Eis então que antes de viajar com mainha eu peguei cinco dias de férias e fui pra Morro de SP. Há anos que eu tinha vontade de conhecer Morro, ouvi falar de lá quando fiz minha primeira viagem sozinha para Itacaré, na Bahia tbm."}),c.jsx("p",{children:"Mas a primeira vez que eu realmente tentei ir pra Morro eu estava em um relacionamento. E claro que o queridão só colocou defeito e achou caro. Por fim, fomos pra Minas. Não vou ser injusta, foi uma viagem boa, Minas não tem como ser ruim. Apesar da gente ter brigado em plena véspera de ano novo e ter ficado tão caro quanto ficaria Morro mas por motivos de cachaça e não de voo, catamarã e passeios de barco…"}),c.jsx("p",{children:"Enfim, manas, dramin é essencial, hein! Muita gente passa mal no catamarã, especialmente na volta. Pra mim na ida foi tranquilo e a volta eu fui de meio semi-terrestre. Mas assim, demora muuuuito. Foram 6hs de trajeto contra 2h30 que seriam de catamarã."}),c.jsx("p",{children:"Primeira vez que escolhi pousada em uma viagem sozinha, estava na vibezinha de ficar de boas. Pousada é mais difícil de fazer amizade se comparado com hostel. E a pousada que escolhi foi na quarta praia, a penúltima, ou seja, era bem afastada. Mas a quarta praia é pura tranquilidade e cheia de piscinas naturais com muuitos peixinhos. Apaixonei nesse lugar."}),c.jsx("p",{children:"O centrinho de Morro fica na segunda praia e boa parte das hospedagens tbm. De onde eu estava até lá dava pra ir de boa andando durante o dia, na maré baixa. Mas à noite só conseguia ir com o transporte da pousada que é rústico mas gratuito, rs. De forma geral as pousadas das quarta e quinta praia oferecem esse transporte em horários específicos durante o dia e a noite."}),c.jsx("p",{children:"Agora, bora de perrengue?! Primeira noite fui pro centrinho e comprei um crepe, caminhei um pouco enquanto comia e quando retornei pra comprar uma bebidinha, cadê meu celular??? “Ah, pronto, roubaram meu celular naquela muvuquinha, fodeu!!!” Retornei pro restaurante que era o ponto de encontro pro transporte e falei com uma funcionária. Ela ligou pro meu celular, chamava mas ninguém atendia. Ela disse que era muito raro ocorrerem roubos por lá, que eu deveria falar com a moça do crepe. Retornei, a moça não estava mais lá, só a barraquinha. Fui refazendo o caminho que fiz anteriormente, passei na muvuquinha e fui pra praia, vi o lixo que joguei a embalagem do crepe e vi algo refletindo a luz da lua por perto… Meu celular! Uffa…"}),c.jsx("p",{children:"Os outros dias foram só alegria e apesar de estar numa pousada distante fiz amizade com uma guria do Sul, nos conhecemos na praia. Fomos na tirolesa, que vista mais linda, o final dela é no mar!!!"}),c.jsxs("ol",{children:[c.jsx("li",{children:"Carol do futuro aqui pra trazer uma dica da minha irmã, que foi pra Morro em sua primeira viagem sozinha!!! Na volta ela foi de catamarã e ficou do lado de fora tomando um arzinho (e umas ondas na cara, rs). Foi tranquilo. Mas lá dentro tinha muita gente vomitando!!! A volta é contra a correnteza, balança muito! Mas um dramin e ar fresco ajudam."}),c.jsx("li",{children:"Sua viagem, suas regras. Em uma das noites já estava trocada para sair e ir pra segunda praia, mas meu livro estava tão delicioso que decidi permanecer na rede lendo e comendo amendoim (mesmo tendo restaurante na pousada). Isso é liberdade, manas. Você decide o que fazer e está tudo bem!"}),c.jsx("li",{children:"Não se desespere, perrengues acontecem. A lição que ficou com a perda temporária do meu celular foi: atenção a seus pertences; mantenha cópias de documentos e informações importantes no email; peça ajuda, uma simples conversa salvou minha noite, minha viagem."}),c.jsx("li",{children:"Antes só do que mal acompanhada. Eu tenho certeza que eu me diverti muito mais sozinha do que se tivesse insistido uns anos atrás pra ir com meu ex. Se afaste de pessoas que põe defeito em tudo, independente de onde esteja. Sabe pq viajar sozinha é tão incrível? Geralmente encontramos pessoas que estão vibrando na mesma sintonia que nós. Tudo flui bem, a vibe bate! E se só quiser ficar sozinha, tá tudo bem tbm. A solitude é maravilhosa, esteja bem consigo antes de procurar a felicidade em outra pessoa."}),c.jsx("li",{children:"Existem viagens e viagens. Você pode gostar de viajar com amigos, com família, com companheira(o) e sozinha. Podem ser viagens completamente diferentes e ambas podem ser ótimas! Não deixe de viajar, mas saiba o que vc quer, pense em vc tbm. Em 2022 eu estava toda ryca, hahah. Janeiro fui sozinha pra Morro na minha pousada isolada; Fevereiro viajei com minha mãe pra Porto de Galinhas, lembrando que eu que convidei minha mãe, eu queria sim viajar com ela; em abril fui pra STL com uma colega e váaarios amigos dela, fomos de trip; agosto fiz a rota das emoções e fiz do meu jeitinho as hospedagens já vislumbrando os momentos em que eu gostaria de conhecer mais pessoas (detalhei em outro tópico); e ainda fui pra Pouso da Cajaíba sozinha de trip (tbm detalhei em outro tópico). Cada viagem com sua vibezinha diferente e todas maravilhosas!!!"})]}),c.jsx("footer",{children:c.jsx(at,{})})]})}const m1=Ce.div`
