`;function p1(){return c.jsxs(m1,{children:[c.jsx(ae,{img:om,alt:"foto da Carol Pascott dentro de um fervedouro de água transparente e rodeado de vegetação no Jalapão"}),c.jsx("h3",{children:"Jalapão, TO | 2019"}),c.jsx("p",{children:"Jalapão é aquela viagem dos sonhos mas que não é tão acessível assim… Fui pra lá qdo eu ainda estava namorando, inclusive, quase terminamos por causa dessa viagem, hahah. Meu ex só estudava e a mãe dele estava há uns anos afastada do trabalho. Eles decidiram viajar em pleno feriado de julho sem necessidade já que  ambos tinham disponibilidade de viajar no meio da semana como geralmente faziam. Oh, nem perceberam que era feriado."}),c.jsx("p",{children:"Maior frio em SP, no sudeste inteiro. Muito frio mesmo. Entrei no site vou de trip e achei uma viagem pro Jalapão com tudo incluso. Opa, minha chance. Boy não gostou, não. “As melhores viagens vc quer ir sozinha.” Pois é, tenho bom gosto e prazer em gastar minha grana com viagem. Mas ok, voltei no site e procurei outro lugar pra ir sozinha. Só viagens pro Sudeste e Sul, lembra que falei que estava frio? Foda-se, eu vou pro Jalapão. Segundo ele, não era sobre eu viajar sozinha, mas sim o local. Afinal, ele vivia viajando sozinho pros congresso dele e eu não ia pq trabalhava."}),c.jsx("p",{children:"Mas, eu não ia ficar em casa sozinha em um feriado prolongado e gelado, fui pro Jalapão. Essa foi uma das decisões mais acertadas da vida! Quando levei um pé na bunda desse cara, em plena véspera da véspera de ano novo de 2020, foi uma das primeiras coisas de que me recordei. Ainda bem que não deixei de viver um sonho por causa dele."}),c.jsx("p",{children:"Ah, se vc leu sobre Morro de SP deve lembrar que mencionei sobre uma briga em um ano novo em MG. Não foi esse ano que terminamos. Sim, ele tinha prazer em estragar datas comemorativas. Certas coisas são livramentos em nossas vidas!!!"}),c.jsx("p",{children:"Enfim, fechei essa viagem bem em cima da hora, como o voo estava incluso eu paguei bem caro. Jalapão foi a viagem mais cara que já fiz considerando o gasto total dividido pelos dias. Engraçado como o boy vivia falando do valor que gastei nessa viagem, como se fosse ele que pagasse meu aluguel e minha cachaça… Vocês acham que se eu tivesse desistido de ir sozinha ele iria pra lá comigo? Com certeza não. E se fosse, iria reclamar o tempo todo."}),c.jsx("p",{children:"Já adianto que o Jalapão não é pra qualquer um, não só pelo preço, mas pela viagem em si. Passamos muito tempo dentro do carro 4x4, muitas vezes apertado e quente. É tipo um circuito, então trocamos de pousada todos os dias."}),c.jsx("p",{children:"Os fervedouros são as principais atrações, é algo único na natureza. Não sabe nadar? Não tem problema, vc não vai afundar. As águas são muito limpas, cada fervedor tem suas características únicas. Maaas, pra manter preservada essa maravilha só é possível ficar 20 minutos em cada fervedouro, não pode passar protetor solar antes de entrar, as regras são rígidas."}),c.jsx("p",{children:"Fui pro Jalapão principalmente por causa dos fervedouros, mas colega, vc não tem ideia da diversidade que este lugar reserva. A cachoeira mais linda que já fui na vida fica por lá, Cachoeira da Formiga. Tbm tem dunas, Pedra Furada, Cânion do Sussuapara. Não é um destino barato e muito menos para quem gosta de conforto, mas se vc curte natureza e diversidade, vá! Vale cada centavo gasto."}),c.jsxs("ol",{children:[c.jsx("li",{children:"Já falei algumas vezes que o Jalapão não é barato, né. Mas o que encareceu minha viagem foi o voo. Se eu tivesse comprado com antecedência teria saído mais barato."}),c.jsx("li",{children:"Essa é uma viagem que é importante ir com agência, pelo menos local. Os carros tem que ser 4x4, não há sinalização na estrada. Há várias opções de pacotes tanto de agências de SP, com ou sem voo, como agências locais."}),c.jsx("li",{children:"Quer muito conhecer o Jalapão mas seus amigos, companheira(o) e/ou família são do tipo “fresco”? Vá sozinha."}),c.jsx("li",{children:"Já falei que é caro, né? Maaas, normalmente todas as refeições e hospedagens estão inclusas no valor do pacote, além do transporte e entrada nos passeios. Você não vai gastar muito por lá, só com bebidas e lembrancinhas se assim quiser. Então é fácil de planejar e administrar seus gastos."}),c.jsx("li",{children:"Jalapão foi a primeira viagem que fiz com tantos cenários diferentes. Eu amo isso e diria que tem sido meu tipo de viagem predileta. Mas é incrível que lá essa diversidade toda está bem perto uma da outra. Outros lugares que eu fui em busca de lugares diferentes em uma única viagem foram: Rota das Emoções; Cusco, Paracas, Huacachina e Guna Yala; e Atacama e Salar de Uyuni."})]}),c.jsx("footer",{children:c.jsx(at,{})})]})}const h1=Ce.div`
